data.expression:
// IN[0]=A, IN[1]=B, IN[2]=C, IN[3]=D （各 [x,y,z]）
// 出力：∠ABC のうち、点 D を含む方の角度の大きさ [rad]
// （D が小さい扇形側にあれば内角、反対なら外角=2π-内角）

fn clamp(x, a, b) { if x < a { a } else if x > b { b } else { x } }

fn angle_ABC_with_D(A, B, C, D) {
    let ux = A[0]-B[0]; let uy = A[1]-B[1]; let uz = A[2]-B[2];
    let vx = C[0]-B[0]; let vy = C[1]-B[1]; let vz = C[2]-B[2];
    let wx = D[0]-B[0]; let wy = D[1]-B[1]; let wz = D[2]-B[2];

    // 長さチェック（退化時は0）
    let uu = ux*ux + uy*uy + uz*uz;
    let vv = vx*vx + vy*vy + vz*vz;
    if uu <= 1.0e-24 || vv <= 1.0e-24 { return 0.0; }

    // 小さい方の角度 θ = acos( (u·v)/(|u||v|) )  … 0..π
    let dot = ux*vx + uy*vy + uz*vz;
    let cosv = dot / sqrt(uu*vv);
    let theta = acos(clamp(cosv, -1.0, 1.0));

    // D が小さい扇形（u→v の間）に入っているか判定
    // n = u×v を法線として、sign(n·(u×w))>=0 かつ sign(n·(w×v))>=0 なら小さい扇形側
    let nx = uy*vz - uz*vy;
    let ny = uz*vx - ux*vz;
    let nz = ux*vy - uy*vx;

    // ほぼ共線（n≈0）のときは判定が不安定なので θ を返す
    let n2 = nx*nx + ny*ny + nz*nz;
    if n2 <= 1.0e-24 * uu * vv { return theta; }

    let uxw_x = uy*wz - uz*wy;                 // u×w
    let uxw_y = uz*wx - ux*wz;
    let uxw_z = ux*wy - uy*wx;
    let s1 = nx*uxw_x + ny*uxw_y + nz*uxw_z;

    let wxv_x = wy*vz - wz*vy;                 // w×v
    let wxv_y = wz*vx - wx*vz;
    let wxv_z = wx*vy - wy*vx;
    let s2 = nx*wxv_x + ny*wxv_y + nz*wxv_z;

    let in_small = (s1 >= -1.0e-12) && (s2 >= -1.0e-12);

    if in_small { theta } else { 6.283185307179586 - theta }
}

// ノード出力
angle_ABC_with_D(IN[0], IN[1], IN[2], IN[3])
